-- Table structure for `x_admin`
-- ----------------------------
DROP TABLE IF EXISTS `x_admin`;
CREATE TABLE `x_admin` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL DEFAULT '',
  `email` varchar(50) NOT NULL DEFAULT '',
  `password` varchar(127) NOT NULL DEFAULT '',
  `salt` varchar(15) NOT NULL DEFAULT '',
  `nickname` varchar(50) NOT NULL DEFAULT '',
  `admintype` char(1) NOT NULL DEFAULT 'A' COMMENT '管理员类型  ABC三类',
  `avatar` varchar(50) NOT NULL DEFAULT '',
  `birthday` varchar(15) NOT NULL DEFAULT '',
  `gender` tinyint(1) NOT NULL DEFAULT '0' COMMENT '性别  0：未知 1：男 2：女',
  `mobile` varchar(15) NOT NULL DEFAULT '',
  `score` mediumint(9) NOT NULL DEFAULT '0' COMMENT '用户积分，充值所得',
  `grade` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户等级',
  `valid` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否审核通过  0未通过 1通过',
  `regtime` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `lastlogin` int(11) NOT NULL DEFAULT '0',
  `lastip` varchar(15) NOT NULL DEFAULT '',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `username` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

